import React, { Component } from 'react';

class City extends Component {
  render() {

    const { value, handleChangeBlur } = this.props;

    return (
      <label>
        Cidade:
        <input
          type="text"
          name="city"
          id="city"
          maxLength="28"
          value={value}
          onChange={handleChangeBlur}
          required
        />
      </label>
    );
  }
}

export default City;
